function runOnRoot(rootElem, controllers) {
    Array.from(rootElem.querySelectorAll('[data-ctrl]')).forEach(function (e) {
        return runOnElement(e, controllers);
    });
}

function runOnElement(ele, controllers) {
    ele.getAttribute('data-ctrl').trim().split(/\s+/g).forEach(function (cName) {
        return tryToRun(ele, cName, controllers);
    });
}

function tryToRun(ele, cName, controllers) {
    var controller = controllers[cName];
    if (controller) {
        try {
            controller(ele);
        } catch (e) {
            console.error(e);
        }
    } else {
        throw new Error('Controller named "' + cName + '" not found.');
    }
}

