    var rootElem = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : document;

    var controllers = {};
    return {
        register: function register(cName, controller) {
            controllers[cName] = controller;
        },
        run: function run() {
            return runOnRoot(rootElem, controllers);
        }
    };
}

module.exports = makeControllerist;
